    'about.about_Body': '<p>OLX \u0A8F \u0AAE\u0AAB\u0AA4 \u0A91\u0AA8\u0AB2\u0ABE\u0A88\u0AA8 \u0AB5\u0AB0\u0ACD\u0A97\u0AC0\u0A95\u0AC3\u0AA4 \u0A9C\u0ABE\u0AB9\u0AC7\u0AB0\u0ABE\u0AA4\u0AA8\u0AC0 \u0A86\u0A97\u0ABE\u0AAE\u0AC0 \u0AAA\u0AC7\u0AA2\u0AC0 \u0A9B\u0AC7.<br /><br />OLX \u0A86\u0AAA\u0AA8\u0AC0 \u0AA8\u0A9C\u0AC0\u0A95\u0AA8\u0ABE \u0AB2\u0ACB\u0A95\u0ACB\u0AA8\u0AC7 \u0AB5\u0AB8\u0ACD\u0AA4\u0AC1 \u0AB5\u0AC7\u0A9A\u0AB5\u0ABE\u0AAE\u0ABE\u0A82, \u0A96\u0AB0\u0AC0\u0AA6\u0AB5\u0ABE\u0AAE\u0ABE\u0A82, \u0AB5\u0AC7\u0AAA\u0ABE\u0AB0 \u0A95\u0AB0\u0AB5\u0ABE\u0AAE\u0ABE\u0A82, \u0A9A\u0AB0\u0ACD\u0A9A\u0ABE \u0A95\u0AB0\u0AB5\u0ABE\u0AAE\u0ABE\u0A82, \u0AB5\u0ACD\u0AAF\u0AB5\u0AB8\u0ACD\u0AA5\u0ABE \u0A95\u0AB0\u0AB5\u0ABE\u0AAE\u0ABE\u0A82 \u0A85\u0AA8\u0AC7 \u0AAE\u0AB3\u0AB5\u0ABE\u0AAE\u0ABE\u0A82 \u0AB8\u0ABE\u0AAE\u0AC7\u0AB2 \u0A9C\u0A9F\u0ABF\u0AB2\u0AA4\u0ABE\u0A93\u0AA8\u0ACB \u0AB8\u0AB0\u0AB3 \u0A89\u0AAA\u0ABE\u0AAF \u0AAA\u0AC2\u0AB0\u0ACB \u0AAA\u0ABE\u0AA1\u0AC7 \u0A9B, \u0AAA\u0A9B\u0AC0 \u0AAD\u0AB2\u0AC7 \u0A86\u0AAA \u0A97\u0AAE\u0AC7 \u0AA4\u0ACD\u0AAF\u0A82 \u0AB0\u0AB9\u0AC7\u0AA4\u0ABE \u0AB9\u0ACB.<br /><br />OLX \u0AAA\u0AB0 \u0A86\u0AAA:<br /><ul><li>\u0AAB\u0ACB\u0A9F\u0ACB\u0A97\u0ACD\u0AB0\u0ABE\u0AAB \u0AA5\u0AC0 \u0A9C\u0ABE\u0AB9\u0AC7\u0AB0\u0ABE\u0AA4 \u0AB8\u0AB0\u0AB3\u0AA4\u0ABE \u0AA5\u0AC0 \u0AB8\u0AC1\u0A82\u0AA6\u0AB0 \u0AAC\u0AA8\u0AC0 \u0AB8\u0A95\u0AC7 \u0A9B\u0AC7</li><li>\u0AAE\u0ABE\u0AB0\u0AC0 OLX\u0AAE\u0ABE\u0A82 \u0A86\u0AAA\u0AA8\u0AC0 \u0AB5\u0AC7\u0A9A\u0ABE\u0AA3, \u0A96\u0AB0\u0AC0\u0AA6\u0AB5\u0ABE\u0AA8\u0AC0 \u0A85\u0AA8\u0AC7 \u0AB8\u0AAE\u0AC1\u0AA6\u0ABE\u0AAF\u0ABF\u0A95 \u0AAA\u0ACD\u0AB0\u0AB5\u0AC3\u0AA4\u0ACD\u0AA4\u0ABF\u0AA8\u0AC7 \u0AA8\u0ABF\u0AAF\u0A82\u0AA4\u0ACD\u0AB0\u0ABF\u0AA4 \u0A95\u0AB0\u0AC0 \u0AB6\u0A95\u0ACB \u0A9B\u0ACB</li><li>\u0A86\u0AAA\u0AA8\u0AC0 \u0AB8\u0ACB\u0AB6\u0ABF\u0AAF\u0AB2 \u0AA8\u0AC7\u0A9F\u0AB5\u0AB0\u0ACD\u0A95\u0ABF\u0A82\u0A97 \u0AAA\u0ACD\u0AB0\u0ACB\u0AAB\u0ABE\u0A88\u0AB2 (\u0AAB\u0AC7\u0AB8\u0AAC\u0AC1\u0A95, \u0AAE\u0ABE\u0AAF\u0AB8\u0ACD\u0AAA\u0AC7\u0AB8,...) \u0AAA\u0AB0 \u0A86\u0AAA\u0AA8\u0AC0 \u0AAF\u0ABE\u0AA6\u0AC0 \u0AB0\u0A9C\u0AC2 \u0A95\u0AB0\u0AC0 \u0AB6\u0A95\u0ACB \u0A9B\u0ACB(Facebook, Myspace, ...)</li><li>\u0A86\u0AAA\u0AA8\u0ABE \u0AAE\u0ACB\u0AAC\u0ABE\u0A88\u0AB2 \u0AAB\u0ACB\u0AA8\u0AAE\u0ABE\u0A82\u0AA5\u0AC0 \u0AB8\u0ABE\u0A88\u0A9F \u0A8F\u0A95\u0ACD\u0AB8\u0AC7\u0AB8 \u0A95\u0AB0\u0AC0 \u0AB6\u0A95\u0ACB \u0A9B\u0ACB</li><li>\u0A86\u0AAA\u0AA8\u0AC0 \u0AB8\u0ACD\u0AA5\u0ABE\u0AA8\u0ABF\u0A95 \u0AAD\u0ABE\u0AB7\u0ABE\u0AAE\u0ABE\u0A82  OLX \u0A9C\u0ACB\u0A88 \u0AB6\u0A95\u0ACB \u0A9B\u0ACB</li></ul><br /><<QTY_COUNTRIES>>\u0AA5\u0AC0 \u0AB5\u0AA7\u0AC1 \u0AA6\u0AC7\u0AB6\u0ACB\u0AAE\u0ABE\u0A82 <<QTY_LANGUAGES>> \u0AAD\u0ABE\u0AB7\u0ABE\u0A93\u0AAE\u0ABE\u0A82 OLX\u0AA8\u0ACB \u0A89\u0AAA\u0AAF\u0ACB\u0A97 \u0AA5\u0ABE\u0AAF \u0A9B\u0AC7. \u0A95\u0A82\u0AAA\u0AA8\u0AC0\u0AA8\u0AC0 \u0AB8\u0ACD\u0AA5\u0ABE\u0AAA\u0AA8\u0ABE \u0AAE\u0ABE\u0AB0\u0ACD\u0A9A 2006\u0AAE\u0ABE\u0A82 \u0AA5\u0A88 \u0AB9\u0AA4\u0AC0 \u0A85\u0AA8\u0AC7 \u0AA4\u0AC7 \u0A96\u0ABE\u0AA8\u0A97\u0AC0 \u0AAE\u0ABE\u0AB2\u0ABF\u0A95\u0AC0\u0AA8\u0AC0 \u0A9B\u0AC7.</p>',
